import React from 'react'
import {Row,Col,Card} from 'react-bootstrap'
import datatrip from '../../data/Trip.json'
function CardTrip() {
    return (
        <>
        <Row>
            {datatrip.map( (item,idx) => 
            <Col key={idx} md={2}>
            <Card>
                <img src={`/../assets/images/${item.img}`} alt={item.img} />
                <h5>{item.title}</h5>
            </Card>
            </Col>
            )}
        </Row>
        </>
    )
}

export default CardTrip
